const NavigationBar = () => {
  return (
    <div>
      {/* <ul>
        <li>
          <Link href="/"> Home</Link>
        </li>
        <li>
          <Link href="/about"> Home</Link>
        </li>
        <li>
          <Link href="/blog"> Blog</Link>
        </li>
        <li>
          <Link href="/contact"> Contact</Link>
        </li>
        <li>
          <Link href="/store"> Store</Link>
        </li>
      </ul> */}

      <Link href="/"> Home</Link>

      <Link href="/about"> Home</Link>

      <Link href="/blog"> Blog</Link>

      <Link href="/contact"> Contact</Link>

      <Link href="/store"> Store</Link>
    </div>
  );
};

export default NavigationBar;
